import React from 'react'
import styled from 'styled-components'
import Text from './Text'

function Component1() {
    return (
        <div>
            <ContainerInside>
                <p>----  GET HELP. GET BETTER.  ----</p>
                <Text/>

            </ContainerInside>
        </div>
    )
}

export default Component1

const ContainerInside = styled.div`

p{
    font-height:19px;
    width:522px;
    color:red;
    letter-spacing:5px;
    margin:155px 738px 510px 180px;

}
`
